import React, {Component} from "react";
import './Results.css';
import $ from 'jquery';
import cofee from '../../Images/001-food.svg';
import project from '../../Images/002-project.svg';
import code from '../../Images/003-code.svg';
import heart from '../../Images/004-heart.svg'

class Results extends Component{
    render() {
        return(
            <div id="results-section" >
                <hr/>
                <h2 style={{paddingBottom: '60px'}}>Resultados</h2>
               <div className="row" >
                    <div className="col-lg-3">
                        <svg className="result-item" style={{color: '#fff'}} src={cofee} width="100" height="100">
                            <path d="M489.865,422.558c-1.664-3.989-5.547-6.592-9.856-6.592H10.676c-4.309,0-8.192,2.603-9.856,6.592
			c-1.664,3.989-0.747,8.576,2.304,11.627l23.915,23.936c14.123,14.101,32.853,21.867,52.8,21.867h330.965
			c19.947,0,38.699-7.765,52.843-21.867l23.915-23.936C490.612,431.134,491.529,426.547,489.865,422.558z M448.543,443.038
			c-10.069,10.069-23.488,15.616-37.717,15.616H79.839c-14.229,0-27.648-5.547-37.717-15.616l-5.717-5.717H454.26L448.543,443.038z"
                            />
                        </svg>
                        <h2>340</h2>
                        <p className="result-text">Xícaras de café</p>
                    </div>
                   <div className="col-lg-3 ">
                       <img className="result-item" src={project} width="100" height="100"/>
                       <h2>340</h2>
                       <p className="result-text">Projetos</p>
                   </div>
                   <div className="col-lg-3 ">
                       <img className="result-item" src={code} width="100" height="100"/>
                       <h2>340</h2>
                       <p className="result-text">Linhas de Código</p>
                   </div>
                   <div className="col-lg-3 ">
                       <img className="result-item" src={heart} width="100" height="100"/>
                       <h2>340</h2>
                       <p className="result-text">Paixão</p>
                   </div>
               </div>
                <hr/>
            </div>
        )
    }
}



$('.count').each(function () {
    $(this).prop('Counter',0).animate({
        Counter: $(this).text()
    }, {
        duration: 4000,
        easing: 'swing',
        step: function (now) {
            $(this).text(Math.ceil(now));
        }
    });
});

export default Results;
